export default{
    async RegisterUser(data){
        try {
            await Axios.post('users',data)
            .then(response => {
                this.posts = response.data
            })
          .catch(e => {
                this.errors.push(e)
              })
            console.log("Heyy")
        } catch (error) {
            console.log(error)
        }
    }
}
